?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Мало кто знает, что эта компания, которая занимается производством одних из лучших автомобилей в мире, выпускает еще и мужские аксессуары класса люкс. Компания была основана в 1972 году Фердинандом Порше. Ассортимент продукции достаточно разнообразен: мобильные телефоны, авторучки, духи, курительные трубки, одежду, очки, запонки, портмоне, чемоданы и оригинальные часы. В 1970 году был изобретен первый хронограф под именем Porsche Design. Это были уникальные часы с черным корпусом, дизайн которых напоминал обод колеса одноименных спортивных автомобилей. В процессе производства часов, Porsche Design использует исключительно высококачественные материалы, которые гарантируют успешную работу часов в течение долгого времени. Абсолютно все модели, так или иначе, напоминают автомобили Porsche. Большинство часов из современных коллекций, выполнены в стиле приборной панели, которая находится во всех автомобилях Porsche. Перед тем, как приступить к производству часов, дизайнеры компании тщательно разрабатывают эскиз будущих часов, и только после этого, мастера-часовщики приступают к своей непосредственной работе. Часы Porsche Design отлично подойдут людям, которым нравятся эти спортивные автомобили, сочетающие в себе скорость, надежность и качество.</span></span></p>
 
